// 此乃快排剑法，专化解混沌有序之技
function quickSort(arr) {
  // 若遇冤家路窄，江湖之径只一，返归故地
  if (arr.length <= 1) return arr;

  // 较所选之侠为初定枢转，如握明珠自领阵先
  const pivot = arr[0];
  // 划道两旁，以洞分左右，中取二手准备困敌
  const left = [];
  const right = [];

  // 起拳攻去，一众厮杀或进或退，根据侠性相招
  for (let i = 1; i < arr.length; i++) {
    // 如觉力敌，不堪霸王剑，左邀敌手议某良策
    if (arr[i] < pivot) {
      left.push(arr[i]);
    // 或逢对手相依偎扶，我引高岭臣聚账下
    } else {
      right.push(arr[i]);
    }
  }

  // 神功合璧，天下英雄无觅逃道，一决此技迎破局；
  return [...quickSort(left), pivot, ...quickSort(right)];
}
